        protected override void OnModelCreating(ModelBuilder builder)
        {
            base.OnModelCreating(builder);

            builder.SetupWorkflow();

            builder.Entity<Addin>(e =>
            {
                e.HasKey(x => new { x.Id, x.Path });
            });

            builder.Entity<Agent>(e =>
            {
                e.HasMany(x => x.JobStages)
                    .WithOne(x => x.Agent)
                    .OnDelete(DeleteBehavior.SetNull);
            });

            builder.Entity<AgentPool>(e =>
            {
                e.HasMany(x => x.JobStages)
                    .WithOne(x => x.AgentPool)
                    .OnDelete(DeleteBehavior.SetNull);
            });

            builder.Entity<BinaryPartition>(e =>
            {
                e.HasKey(x => new { x.BinaryId, x.Partition });
            });

            builder.Entity<GalleryPackage>(e =>
            {
                e.HasKey(x => new { x.Id, x.Version });
                e.HasIndex(x => x.ListInGallery);
            });

            builder.Entity<LoginProvider>(e =>
            {
                e.HasIndex(x => new { x.Enabled, x.Priority });
                e.HasIndex(x => x.Mode);
                e.HasMany(x => x.Users)
                    .WithOne(x => x.LoginProvider)
                    .OnDelete(DeleteBehavior.Cascade);
            });

            builder.Entity<Log>(e =>
            {
                e.HasIndex(x => new { x.PipelineId, x.JobNumber, x.LogSet, x.Time});
            });

            builder.Entity<Metrics>(e =>
            {
                e.HasIndex(x => new { x.Timestamp, x.AgentId, x.Type });
            });

            builder.Entity<ProjectMember>(e =>
            {
                e.HasKey(x => new { x.ProjectId, x.UserId });
            });

            builder.Entity<Pipeline>(e =>
            {
                e.HasMany<Job>()
                    .WithOne(x => x.Pipeline)
                    .OnDelete(DeleteBehavior.SetNull);
                e.HasIndex(x => x.Visibility);
                e.HasMany(x => x.Jobs)
                    .WithOne(x => x.Pipeline)
                    .OnDelete(DeleteBehavior.Cascade);
            });

            builder.Entity<PipelineAccess>(e => 
            {
                e.HasKey(x => new { x.PipelineId, x.UserId });
            });

            builder.Entity<Job>(e =>
            {
                e.HasIndex(x => new { x.PipelineId, x.Number }).IsUnique();
                e.HasIndex(x => x.TriggeredAt);
                e.HasIndex(x => x.Status);
            });

            builder.Entity<JobStage>(e =>
            {
                e.HasIndex(x => x.Status);
            });

            builder.Entity<JobVariable>(e =>
            {
                e.HasKey(x => new { x.PipelineJobId, x.Name });
            });

            builder.Entity<JobLabel>(e =>
            {
                e.HasKey(x => new { x.JobId, x.Label });
                e.HasIndex(x => x.Label);
            });

            builder.Entity<JobExtension>(e =>
            {
                e.HasIndex(x => x.Priority);
            });

            builder.Entity<PipelineTrigger>(e =>
            {
                e.HasIndex(x => x.Enabled);
                e.HasOne(x => x.Provider)
                    .WithMany(x => x.PipelineTriggers)
                    .OnDelete(DeleteBehavior.Cascade);
            });

            builder.Entity<PipelineFavorite>(e =>
            {
                e.HasKey(x => new { x.PipelineId, x.UserId });
            });

            builder.Entity<PersonalAccessToken>(e =>
            {
                e.HasIndex(x => x.Token).IsUnique();
                e.HasIndex(x => new { x.Token, x.ExpireAt });
            });

            builder.Entity<Policy>(e =>
            {
                e.HasKey(x => x.Key);
                e.HasIndex(x => x.Order);
            });

            builder.Entity<TriggerProvider>(e =>
            {
                e.HasIndex(x => x.Priority);
            });

            builder.Entity<User>(e =>
            {
                e.HasIndex(x => new { x.LoginProviderId, x.Username }).IsUnique();
            });

            builder.Entity<JobStageWorkflow>(e =>
            {
                e.HasKey(x => new { x.JobStageId, x.WorkflowInstanceId });
                e.HasOne(x => x.JobStage).WithOne(x => x.JobStageWorkflow).IsRequired(false);
            });

            var restricts = builder.Model.GetEntityTypes()
                .SelectMany(t => t.GetForeignKeys())
                .Where(fk => fk.DeleteBehavior == DeleteBehavior.Restrict);

            foreach (var fk in restricts)
            {
                fk.DeleteBehavior = DeleteBehavior.Cascade;
            }
        }
    }
}
